import React from "react";

const Animation = () => {
  return (
    <svg
      width="500px"
      height="500px"
      viewBox="0 0 500 500"
      preserveAspectRatio="none"
    >
      <path
        className="morph"
        d="M 70.710678,404.03551 258.59905,63.6141 424.26407,392.92383 Z"
      ></path>
    </svg>
  );
};

export default Animation;
